import { Component, ElementRef, OnInit, ViewChild } from '@angular/core';
import { Apollo, ApolloBase, gql } from 'apollo-angular';
import { Invoice } from 'src/app/model/invoice';
import { GET_INVOICE, GET_INVOICES, GET_INVOICESPEC } from '../table/invoice';
import { NgbModal } from '@ng-bootstrap/ng-bootstrap';
import jsPDF from 'jspdf';
import html2canvas from 'html2canvas';
@Component({
  selector: 'app-statments',
  templateUrl: './statments.component.html',
  styleUrls: ['./statments.component.css'],
})
export class StatmentsComponent implements OnInit {
  apollo: ApolloBase;
  all2: Invoice[] = [];
  @ViewChild('invoice') invoiceElement!: ElementRef;
  constructor(private apolloProvider: Apollo, private modalService: NgbModal) {
    this.apollo = this.apolloProvider.use('addwafariz');
  }
  openXl(longContent: any) {
    this.modalService.open(longContent, { size: 'xl' });
  }
  ngOnInit(): void {
    this.apollo
      .watchQuery({
        query: GET_INVOICESPEC,
      })
      .valueChanges.subscribe(({ data }: any) => {
        this.all2 = data.GetInvoiceSpec;
        console.log(this.all2);
      });
  }




  public openPDF(): void {
    let myPdfFonts = {
      "NotoNaskhArabic-Bold.ttf": "",
      "NotoNaskhArabic-Medium.ttf": "",
      "NotoNaskhArabic-Regular.ttf": "",
      "NotoNaskhArabic-SemiBold.ttf": "",

    }
    let myFont = {
      NotoNaskhArabic: {
        normal: 'NotoNaskhArabic-Regular.ttf',
        bold: 'NotoNaskhArabic-Bold.ttf',
        italics: 'NotoNaskhArabic-Bold.ttf',
        bolditalics: 'NotoNaskhArabic-Bold.ttf'
      }
    }
    let DATA: any = document.getElementById('invoice');

    html2canvas(DATA).then((canvas) => {
      let fileWidth = 208;
      let fileHeight = (canvas.height * fileWidth) / canvas.width;
      const FILEURI = canvas.toDataURL('image/png');
      let PDF = new jsPDF('p', 'mm', 'a4');
      let position = 0;
      PDF.setFont(myPdfFonts['NotoNaskhArabic-Regular.ttf']);
      PDF.addImage(FILEURI, 'PNG', 0, position, fileWidth, fileHeight);
      PDF.save('angular-demo.pdf');
    });
  }
}
